export const toc = [{
  value: 'Materials:',
  id: 'materials',
  children: []
}, {
  value: 'Procedure',
  id: 'procedure',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`The Sip & Puff switch is a device which is activated by sipping and puffing, simulating the functions of “left and right-click”. When the user puffs or blows, the `}<strong parentName="p">{`left-click`}</strong>{` function is activated, on the other side, when the user sips or inhales the `}<strong parentName="p">{`right-click`}</strong>{` function is activated.`}</p>
    <p>{`The device is compatible with Android, Windows, MacOS and Linux. It also allows the selection of items with the screen scanning functionality of OTTAA Project.`}</p>
    <p><img alt={"WhatsApp Image 2020-09-25 at 11.26.01.jpeg"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./../static/img/sippandpuff1.jpeg").default} /></p>
    <p><img alt={"WhatsApp Image 2020-09-25 at 11.26.01 (1).jpeg"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./../static/img/sippandpuff2.jpeg").default} /></p>
    <h2 {...{
      "id": "materials"
    }}>{`Materials:`}</h2>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Flexible support with a clamp.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Hydrophobic filter. `}<a parentName="p" {...{
            "href": "https://articulo.mercadolibre.com.ar/MLA-849921140-filtro-hidrofobico-para-aspirador-silfab-_JM#position=1&type=item&tracking_id=da9113df-91f0-45ce-b7c5-83a87844b6d7"
          }}>{`Buy`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`2 screws M4x25mm.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`2 nuts M4.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Transparent PVC glass hose pipe. ID:4mm, ED:7mm, L=400mm.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`2 pressure switches MLP 500 C rank. `}<a parentName="p" {...{
            "href": "https://presostato.com.ar/producto/52/mpl-500-rango-c"
          }}>{`Buy`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`PCB - Mouse Genius DX120. `}<a parentName="p" {...{
            "href": "https://articulo.mercadolibre.com.ar/MLA-868480546-mouse-genius-dx-120-usb-1000dpi-optico-ambidiestro-black-pc-_JM?matt_tool=80963329&matt_word=&gclid=Cj0KCQjwqfz6BRD8ARIsAIXQCf3dexrefgJtlCriQ_hqqby_NyAbSTyiqNkMF7KxlSYF95a_obAYnMAaAn9cEALw_wcB"
          }}>{`Buy`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`3D printed casing (2 parts). `}<a parentName="p" {...{
            "href": "https://drive.google.com/file/d/17BMIjcQll2dOxq3W2ZBUsT5ZiVlRoz3s/view?usp=sharing"
          }}>{`A`}</a>{`, `}<a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1zvj9SR6ah-anW4CctGl6CT1z0IOK82px/view?usp=sharing"
          }}>{`B`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`4 hose pipe -support fixings. `}<a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1HbCnnXeuYTbX_WMHArGrw_35p7Eosd7Q/view?usp=sharing"
          }}>{`C`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Support-filter fixing. `}<a parentName="p" {...{
            "href": "https://drive.google.com/file/d/14uz6mYZql4QL4XS0-hSMjVuTAYJonyys/view?usp=sharing"
          }}>{`D`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`"T shaped" pipe. `}<a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1TsNV6Lg1sQ0KczNsLEINU1BqgpoNtBeG/view?usp=sharing"
          }}>{`E`}</a></p>
      </li>
    </ul>
    <h2 {...{
      "id": "procedure"
    }}>{`Procedure`}</h2>
    <ol>
      <li parentName="ol">
        <h3 parentName="li" {...{
          "id": "3d-printing"
        }}>{`3D Printing`}</h3>
      </li>
    </ol>
    <p>{`Parts A, B, C, D and E are 3D printed with the follow general configuration:`}</p>
    <p>{`Material: PLA.`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Temperature of the hotend: 210-215 °C.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Temperature of the print bed: 50-60 °C.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Top and Bottom Layers: 3.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Perimeter Shells: 3.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Infill: 25%.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Support: 75°(only B.stl).`}</p>
      </li>
    </ul>
    <ol {...{
      "start": 2
    }}>
      <li parentName="ol">
        <h3 parentName="li" {...{
          "id": "dismantle-mouse-genius-dx120"
        }}>{`Dismantle Mouse Genius DX120`}</h3>
      </li>
    </ol>
    <p>{`Take out the mouse PCB circuit board and remove the limit switches from the left and right-click. On those pins, then weld the wires on the common and normally open pin of the limit switch. On the other end, plug the pins of the pressure switches, the left click connected to the pressure switch that works with pressure, and the right one connected to the switch that works with vacuum. (`}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/16DKVE9Sds9tDuZaMsQOr80WlpFTG2QYS/view?usp=sharing"
      }}>{`Figure 1`}</a>{`)`}</p>
    <ol {...{
      "start": 3
    }}>
      <li parentName="ol">
        <h3 parentName="li" {...{
          "id": "place-the-pressure-switches"
        }}>{`Place the pressure switches`}</h3>
      </li>
    </ol>
    <p>{`Cut two 15mm pieces of PVC glass hose pipe. With the help of heat, introduce the hose into the short inlet of part E.`}</p>
    <p>{`Place part E in part B as shown on the image (`}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1XSPxb4lb6Ttxjm1byzwLoEcQ53Q4Xe6T/view?usp=sharing"
      }}>{`Figure 2`}</a>{`), inserting the long inlet of part E through the upper hole of part B.`}</p>
    <ol {...{
      "start": 4
    }}>
      <li parentName="ol">
        <h3 parentName="li" {...{
          "id": "place-the-pcb"
        }}>{`Place the PCB`}</h3>
      </li>
    </ol>
    <p>{`With a glue gun, stick the mouse PCB circuit board to part A (`}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1FNYH68-WZYc3Znq0fQ2r_nOPmDCkETBA/view?usp=sharing"
      }}>{`Figure 3`}</a>{`).`}</p>
    <p>{`Introduce the USB cable through the bottom hole of the same housing.`}</p>
    <ol {...{
      "start": 5
    }}>
      <li parentName="ol">
        <h3 parentName="li" {...{
          "id": "assemble-housings"
        }}>{`Assemble housings`}</h3>
      </li>
    </ol>
    <p>{`Place the flexible support in the corresponding space between both housings. Then, insert the nuts in the corresponding hole, and fix it with M4x25mm screws using an Allen key. (`}<a parentName="p" {...{
        "href": "https://drive.google.com/file/d/1vbmZQFmx6n_jIQTqaIgdDlcnOhExWa2C/view?usp=sharing"
      }}>{`Figure 4`}</a>{`)`}</p>
    <ol {...{
      "start": 6
    }}>
      <li parentName="ol">
        <h3 parentName="li" {...{
          "id": "place-the-nozzle-with-a-moisture-trap"
        }}>{`Place the nozzle with a moisture trap.`}</h3>
      </li>
    </ol>
    <ul>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1dz4wXeZqUFKGeIo-RRqZinKku3QrAE2q/view?usp=sharing"
          }}>{`Figure 5`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1ypjOI5x-I0F9eeONKC6bmoX-YO034_8Q/view?usp=sharing"
          }}>{`Figure 6`}</a></p>
      </li>
    </ul>
    <ol {...{
      "start": 7
    }}>
      <li parentName="ol">
        <h3 parentName="li" {...{
          "id": "blueprints"
        }}>{`Blueprints`}</h3>
      </li>
    </ol>
    <p>{`The technical drawings of the parts to be printed are shown below:`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1TC-uZp4uZrY7NZ4-ZMa-2b63L8OdyEef/view?usp=sharing"
          }}>{`A`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1LyK-QjfQ4Suo63GRJ7FblGmHZL_U4hWu/view?usp=sharing"
          }}>{`B`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1L0KY8f73qWX24lJIytsBOOmZ5gMfDfgf/view?usp=sharing"
          }}>{`C`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1ioHFwXeTXKKvBzLcFQg67gugzbX6ZeH3/view?usp=sharing"
          }}>{`D`}</a></p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://drive.google.com/file/d/1hbQMTjLFX2qzNDF4DlehQUV3gmxD1BGV/view?usp=sharing"
          }}>{`E`}</a></p>
      </li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
